  true,\n\t\"url\": null,\n\t\"notes\": \"In this Phase I SBIR project for NASA, Flexure
  Engineering of Greenbelt, MD will design and develop a system that marries the technologies
  of Thermal Vacuum Chambers and Non-Contact Metrology Systems providing NASA with
  sub-micron, three sigma uncertainties on Flight Hardware while at temperature (typically
  cryogenic, down to 30K) and in high vacuum (&gt;10E-6 torr).rnrnThis innovation
  provides NASA and the Aerospace Community increased capabilities for the alignment
  and performance verification of telescope optical surfaces and telescope optical
  assemblies.rnrnA key feature of the system is that the metrology system is housed
  outside of the harsh environment of the chamber, looking in through one or more
  windows and yet providing sub-micron uncertainties across large distances and of
  complex shapes. The cryo/vac system in Phase I and II will apply primarily to the
  integration and testing of optical space flight hardware while at the commercialization
  Phase III, the techniques will be generalized to include other settings such as
  optical, electronics and harsh environment manufacturing chambers and hermetically
  sealed fabrication and assembly systems.rn\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
